// CarList.js
import React from 'react';
import Car from '../Car/Car';
import './carsList.css'

const CarList = () => {
  const cars = [
    {
        name: "Tesla Model S",
        description: "A fully electric sedan with autopilot, fast acceleration, and a luxurious interior.",
        price: 79999,
        imageUrl: "https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcST-oeQCpBAvrAcPlg0_pNTch7ufRQR8rYpYggL5_OAiGnFb-2Biq0bFLM&s",
    },
    {
        name: "BMW M3",
        description: "A high-performance sports sedan with a powerful engine and advanced driving dynamics.",
        price: 69999,
        imageUrl: "https://cdn.bmwblog.com/wp-content/uploads/2020/09/2021-bmw-m3.jpg",
    },
    {
        name: "Audi R8",
        description: "A sleek and stylish sports car with a V10 engine, offering a thrilling driving experience.",
        price: 142000,
        imageUrl: "https://cdn.motor1.com/images/mgl/jwM6J/s1/2020-audi-r8.jpg",
    },
    {
        name: "Mercedes-Benz G-Class",
        description: "An iconic SUV with a bold design, luxurious interior, and impressive off-road capabilities.",
        price: 130000,
        imageUrl: "https://cdn.motor1.com/images/mgl/YW6Wx/s3/2021-mercedes-benz-g-class.jpg",
    },
    {
        name: "Porsche 911",
        description: "A legendary sports car with a distinctive design, powerful performance, and great handling.",
        price: 115000,
        imageUrl: "https://files.porsche.com/filestore/image/multimedia/none/992-carrera-safety/normal/8b85b9d8-d131-11e9-80c4-005056bbdc38;sH;twebp/porsche-normal.webp",
    },
];


    return (
        <div className="car-list">
            {cars.map((car, index) => (
                <Car key={index} {...car} />
            ))}
        </div>
    );
};

export default CarList;
